import React from 'react';
import PropTypes from 'prop-types';

node_modules
function PostsList(props) {
    const {posts} = props
    return (
        <div>
            <ul>
                {posts.map(post=>(
                    <li key={post._id} data-id={post._id}>{post.name}</li>
                ))}
            </ul>
        </div>
    );
}

export default PostsList;
